(function($) {

    $.fn.table_head_sticky = function( options ) {
        
      // Establish our default settings
        var settings = $.extend({
            top_padding:0,
            top_padding_mobile:0
        }, options);
        
        var onscroll_set = false;
        var onresize_set = false;
        var items = [];
        var window_width = $(window).width();
        var is_mobile = window_width < 960?true:false;
        
        return this.each( function() {
          
            
            var elem = $(this);
            
            for(var i in items){
                if(items[i].is(elem)){
                    return;
                }
            }
            
            var calculate = function(elem){
                var thead = elem.find('thead');
                var th = thead.find('th');
                
                elem.pos = elem.offset();
                var height = elem.outerHeight(true);

                var thead_height = thead.outerHeight(true);
                elem.table = $('<div style="overflow:hidden;z-index:999;position:absolute;width:'+elem.innerWidth()+'px;height:'+thead_height+'px;" class="hide table-fixed-header '+thead.attr('data-sticky-add-class')+'"><div class="trigger" style="position:relative;"><div class="table-responsive" style="overflow:hidden;"><table style="width:'+elem.width()+'px" class="'+elem.attr('class')+'"></table></div></div></div>');
                elem.table.find('table').prepend(thead.clone(true));
           
                //<thead>'+thead.html()+'</tead>
                $('body').prepend(elem.table);
                
                if(window_width < 960)
                    elem.margin_top = settings.top_padding_mobile;
                else
                    elem.margin_top = settings.top_padding;

                elem.table.find('th').each(function(i,e){
                   $(e).css('width', $(th[i]).outerWidth(true)+'px').css('height', $(th[i]).outerHeight(true)+'px');
                });
                
                elem.is_visible = false;
                elem.max = elem.pos.top + height - thead_height - elem.margin_top;
                elem.y_start = elem.pos.top + thead.outerHeight(true);


               
            }
            
            var on_scroll_timeout = null;
            var on_scroll_operation = function(){
                
                function operation(){
                     var y =$(window).scrollTop();

                    for(var ii in items){
                        var ll = items[ii];
                        ll.table.css('left',ll.pos.left+'px');

                        if (y > ll.max){
                            if(ll.is_visible){
                                ll.is_visible = false;
                                ll.table.addClass('hide');
                            }
                        }else if(y >= ll.y_start){
                            if(!ll.is_visible){
                                ll.is_visible=true;
                                ll.table.removeClass('hide');
                            }
                            
                            ll.table.css('top',(y+ll.margin_top)+'px');
                        }else{
                            if(ll.is_visible){
                                ll.table.addClass('hide');
                                ll.is_visible=false;
                            }
                        }

                    }
                }
                
                if(is_mobile){
                    if(on_scroll_timeout)
                        clearTimeout(on_scroll_timeout);

                    on_scroll_timeout = setTimeout(function(){
                        operation();
                    },80);
                }else{
                    operation();
                }
                
                
            }
            
            if(!onresize_set){
                $(window).on( 'resize', function(){
                    $('.table-fixed-header').remove();
                    for(var i in items){
                        calculate(items[i]);
                    }
                });
                onresize_set = true;
            }
            
            if(!onscroll_set){
                
                $(document).on( 'scroll', function(){
                    on_scroll_operation();    
                });
                onscroll_set=true;
            }

            calculate(elem);
            items.push(elem);
               
            elem.parent().on('scroll', function(){
               var x = $(this).scrollLeft();
          console.log(x);
               elem.table.find('.table-responsive').css('margin-left', x*-1+'px');
            });
        });
    }


    $.fn.sticky_in_parent = function( options ) {

        // Establish our default settings
        var settings = $.extend({
            parent: $(this).parent(),
            top_padding:0
        }, options);
        
        var on_scroll = false;
        var on_resize = false;
        var items = [];
        
        var on_scroll_operation = function(){
      
            var y = $(window).scrollTop();
            for(var k in items){
                var item = items[k];
      
                var max = item.max_pos_bottom - item.elem_height;
                if(y > item.min_pos_top && y < max){
                    item.css('position','fixed');
                    item.css('top',settings.top_padding+'px');
               
                }else if(y > max || y < item.min_pos_top){
                    item.css('position','absolute');
                    if(y > item.min_pos_top)
                        item.css('top',max+'px');
                    else
                        item.css('top',item.elem_top_pos+'px');
       
                    item.css('left',item.elem_left_pos+'px');
                    item.append_to_body = 1;
                    item.appendTo('body');
                }
            }
        }
        
        var calc_position = function(obj){
            if(obj.append_to_body){
                obj.appendTo(obj.parent_elem);
            }
            
            obj.css('width','auto').css('left','auto').css('top','auto').css('position','');
            
            var pos = obj.settings.parent.offset();
            var elem_pos = obj.offset();
            
            obj.min_pos_top = pos.top;
            obj.parent_height = obj.settings.parent.outerHeight(true);
            obj.elem_height = obj.outerHeight(true);
            obj.elem_left_pos = elem_pos.left;
            obj.elem_top_pos = elem_pos.top;
            obj.elem_default_parent = obj.parent();
            obj.parent_elem = obj.parent();
            obj.max_pos_bottom = pos.top + obj.parent_height;
     
            obj.css('width', obj.width()+'px')
            return obj;
        }
        
        return this.each( function() {
            if(!settings.parent){
                console.log('No set parent');
                return this;
            }
            
            var elem = $(this);
            var found = false;
            for(var k in items){
                if(items[k].is(elem)){
                    found = true;
                    return;
                }
            }
            
            elem.settings = settings;
            
            //calc max top and bottom
            calc_position(elem);
           
            
            if(!found){
                items.push(elem);
            }
            
            if(!on_resize){
                $( window ).resize(function() {
                  
                    for(var k in items){
                        calc_position(items[k]);
                    }
                });
                
                on_resize = true;
            }
            
            if(!on_scroll){
                $(document).on( 'scroll', function(){
                    on_scroll_operation();
                });

                on_scroll = true;
            }
            
            
        });

    }

}(jQuery));



(function ($) {
	$.fn.blink = function (options) {
		var defaults = { delay: 500 };
		var options = $.extend(defaults, options);
		return $(this).each(function (idx, itm) {
			setInterval(function () {
				if ($(itm).css("visibility") === "visible") {
					$(itm).css('visibility', 'hidden');
				}
				else {
					$(itm).css('visibility', 'visible');
				}
			}, options.delay);
		});
	}
} (jQuery));

